import './App.css';
import 'bootstrap/dist/css/bootstrap.css';

import Header from "./Header";
import Main from "./main";
import Product from "./product";


function App() {
  return (
      <div className={App}>
          <Header />
          <Main />
          <Product />
      </div>

  );

};

export default App;
